import React from 'react';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import Simeon from '../site-images/simeon.jpg';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    paper: {
        flexGrow: 1,
        padding: theme.spacing(2),
        color: theme.palette.text.secondary,
        textAlign: 'center',
    },
    img: {
        height: '50%',
        width: '100%',
    },
}));

export default function GridExample() {
    const classes = useStyles();

    return (
        <Paper 
            className={classes.paper} 
            elevation={3} 
        >
            <Grid 
                container 
            >
                <Grid 
                    item 
                    xs={4} 
                >
                    <img 
                        className={classes.img}
                        alt='Simeon Ikudabo'
                        src={Simeon}
                    />
                </Grid>
                <Grid 
                    item 
                    container 
                    xs={4}
                    direction='column' 
                >
                    <Grid 
                        item 
                    >
                        <Typography 
                            variant='h6' 
                            component='h6' 
                        > 
                            Standard License 
                        </Typography>
                    </Grid>
                    <Grid 
                        item 
                        style={{
                            marginTop: 2,
                        }}
                    >
                        <Typography 
                            variant='body1' 
                            component='p' 
                        >
                            New fragences by Kendall Jenner.
                        </Typography>
                    </Grid>
                    <Grid 
                        item 
                        style={{
                            marginTop: 2,
                        }}
                    >
                        <Typography 
                            variant='subtitle1'
                            component='span' 
                            color='textSecondary' 
                        >
                            Product ID: 2030402
                        </Typography>
                    </Grid>
                    <Grid 
                        item 
                    >
                        <Button>
                            Learn More 
                        </Button>
                    </Grid>
                </Grid>
                <Grid 
                    item 
                    xs={4} 
                >
                    <Typography 
                        variant='h6' 
                        component='h6' 
                    >
                        $19.95
                    </Typography>
                </Grid>
            </Grid>
        </Paper>
    );
}
